import React from 'react'

class Blocks extends React.Component {
   state = {
      matches: []
   }

   showMatches = () => (
      <div>
      matches
      </div>
   )
  render () {
      return (
            <div className="home_matches">
                {this.showMatches(this.state.matches)}
            </div>
      )
  }
}

export default Blocks;
